INSERT INTO `announcement` VALUES ('4', '<h3 style=\"margin: 0px 0px 0.5em; font-size: 14pt; color: rgb(153, 102, 51); font-family: Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Managing Tomcat</h3><p style=\"margin: 0px 0px 0.1em; font-size: 10.5pt; color: rgb(119, 85, 51); font-family: Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">For security, access to the<span>&nbsp;</span><a href=\"http://localhost:8080/manager/html\" style=\"color: rgb(102, 0, 0);\">manager webapp</a><span>&nbsp;</span>is restricted. Users are defined in:</p><pre style=\"text-indent: 0.25em; width: 264.6px; font-size: 11.7px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">$CATALINA_HOME/conf/tomcat-users.xml</pre><p style=\"margin: 0px 0px 0.1em; font-size: 10.5pt; color: rgb(119, 85, 51); font-family: Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initi