INSERT INTO `operator_log` VALUES ('324', '297', '浏览房源ID:297详情', '查看', 'zhengjun', '2017-11-18 09:47:40', 'BaseHouse(id=297, title=null, type=3, typeStr=null, housename=中关村E世界财富中心, tradetype=1, tradetypeStr=null, price=null, rental=7.5, unitprice=null, rentalpricetype=7, rentalpricetypeStr=null, floor=11, room=C1142, acreage=415.0, orientation=0, officetag=, officetype=null, paymentmethod=5, seemethod=0, source=8, iskey=null, remarks=办公室位于中关村西区e世界财富中心11层，\n与中钢国际广场隔街相望，\n南接10万平米亚洲空中花园。\n紧邻地铁4号线中关村站及10号线海淀黄庄站，\n附近多路公交站，7.5包物业取暖，不含发票。空房，提前半小时。业主过来开门。不出中介费。可以注册。\n中关村地下交通环廊直通地库，车位充足。\n精装修南、西两向落地窗，采光通风良好。\n含会议室两间、独立办公室五间、储物间两间，\n公共办公区整体朝南，全套高档办公家具。\n可注册，可随时看房立即入驻。\n业主直租，压二付三，含物业取暖，非诚勿扰！, image=null, createtime=Wed Oct 11 10:52:28 CST 2017, updatetime=Wed Oct 11 10:58:13 CST 2017, operator=zhangchen, operatorName=null, founder=zhangchen, founderName=null, owner=业主, ownerphone=18610480180, propertycompany=null, propertphone=null, housestatus=8, housestatusStr=null, properties=0, propertiesStr=null, status=0, statusStr=null, isfollow=0, isfollowStr=null, follownum=0, seenum=0, followsee=0, followseeStr=null, isstatus=0, isstatusStr=null, diskstatus=0, diskstatusStr=null, sealingdisk=0, sealingdiskStr=null)');
